import React from 'react';
import Emojy from'./Emojy';

function Slot(){
    if(Emojy[1].x===Emojy[1].y && Emojy[1].y===Emojy[1].z){
        return <>
        <div className="inner_slot">
            <h1 className='emj_slot'>{Emojy[1].x} {Emojy[1].y} {Emojy[1].z}</h1>
            <p className='slot_text'>This is matching</p>
            <hr />
        </div>
        </>
    }
    else{
        return <>
        <div className="inner_slot">
            <h1 className='emj_slot'>{Emojy[1].x} {Emojy[1].y} {Emojy[1].z}</h1>
            <p className='slot_text_not'>This is not matching</p>
            <hr />
        </div>
        </>
    }
}

export default Slot;
